    key: Accept
    value: text/html,application/xhtml+xml,application/xml;q=0(?-s:.)9,image/avif,image/webp,*/*;q=0(?-s:.)8
  method: GET
  description: ""
  meta: ""
- URI: ^/flasgger_static/swagger-ui.css$
  body: (?:)
